import React, { useState } from 'react';
import './index.css';
const Ques=(props)=>{
    const [fun,set2]=useState(false);
    function open(){
        set2(!fun);
    }
    return (<>
        
            <button onClick={open}>{fun? "-" : "+" }</button>
            <span>{props.question}</span>
            <span>{fun && <p>{props.answer}</p>}</span>
       
    </>);
}
export default Ques;
